/* eslint-disable prettier/prettier */
/* eslint-disable react/prop-types */
import styles from './profile.module.css';

import React from 'react';

import { useParams } from 'react-router-dom';

function Profile({ users }) {
  console.log(users);
  const { uuid } = useParams();
  console.log(uuid);

  return (
    <div className={styles.user}>
      {users.filter(user => user.login.uuid === uuid).map(userProfile => (
        <>
          <div className={styles.container}>
            <div className={styles.rightTopOne}>
              <div className={styles.rightTopTwo}>

              </div>
              <div class="right-top-three">

              </div>
            </div>
            <div class="left-top-img">

            </div>
            <div class="right-bottom-one">
              {userProfile.login.username}
            </div>
            <div class="right-bottom-two">

            </div>
            <div class="right-bottom-three">

            </div>
            <div class="right-bottom-four"></div>
            <div class="left-bottom-one"></div>
            <div class="left-bottom-two"></div>
            <div class="left-bottom-three"></div>
            <div class="left-bottom-four"></div>
        </div>
      </>
      ))}
    </div>
  );
}

export default Profile;
